import gql from "graphql-tag";

export const ALL_LAUNCHES = gql`
  query LaunchQuery {
    launch {
      flight_number
      mission_name
      launch_year
      launch_success
      launch_date_local
      details
      rocket {
        rocket_id
        rocket_name
        rocket_type
      }
    }
  }
`;
